googleusercontent.com/a-/AOh14Gjum1CLoYhsEpNQbyDi8PleMnJEcsZeFIzI69rlcw\\u003dc0x00000000-cc-rp-ba4\",\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IWSgBMAA\"]\n,\"EgIIAg\"]\n,[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/117894898974601698628%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IYCgAMAA\\u0026usg\\u003dAOvVaw2Y27rG2-twfI0-VLx-oEPG\",\"ハナカワ\",\"https://lh3.googleusercontent.com/a-/AOh14GgqoJaWWE4tVIQyBocMYxBYPTuC4pMtISKJ0An4L90\\u003dc0x00000000-cc-rp-ba6\",\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IYCgAMAA\"]\n,\"1 か月前\",null,\"７月・８月・９月のシーズンでは島への移動の船代と軽食込みで5800円。移動するだけでこの値段は高いですね。\\nビーチではブイで囲われた極狭い範囲でしか泳ぐことが出来ません。またその狭い遊泳域の中でシュノーケリングするならなライフジャケット必須。ライフジャケットを付けずにシュノーケルマスクをつけて海に入ると監視員がすっ飛んで来て注意されます。ライフジャケットを持参していない場合はレンタル(別料金)になります。水浴びするだけならライフジャケット無しで海に入っても大丈夫です。\\nこれでは何も出来ないので受付に行って話をすると「船でシュノーケリングポイントまで移動して潜れます」…と。お値段3000円(別料金)。\\n桟橋にある船に乗ってナガンヌ島から離れたポイントまで行くのかなぁ〜と思いきや、目と鼻の先にあるポイントまで漂いながら移動。エンジンをかけるまでもない程の距離の場所でシュノーケリング。もちろんライフジャケット必須。脱ぐ事も出来ず。ライフジャケットを着けたまま潜る練習は出来たかな。結果的にはほとんど漂うだけで終わりです。ナマコが沢山居ました。\\n\\n安全第一な観光地…なんですね。\\n初めてシュノーケリングします！…という人意外は凄くつまらないツアーです。泳ぐ練習はできる程度と思った方がいいです。これなら開催時期が決まってるみたいだけど、パラセーリングとかホエールウォッチングがセットになったツアーの方が楽しめるんじゃないかな…たぶん…。クジラが見つからなかったら…それはそれでしんどいか。\\nパラソルやコテージ、ロッカーなど全てに別料金が発生するので割高感がもの凄く高いです。\\n当日は10分で帰りたくなりましたが、帰りの船の都合もあるので食堂で飲んで時間を潰しました。\",1,null,\"117894898974601698628\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChZDSUhNMG9nS0VJQ0FnSURDNnRIT2V3EAE\\u0026entityid\\u003dChZDSUhNMG9nS0VJQ0FnSURDNnRIT2V3Ei0KFkNJSE0wb2dLRUlDQWdJQ3k3Y2VOZVESE0Nnd0ktcHFhZ1FZUS1MYkNvZ0UaLgoXQ0lITTBvZ0tFSUNBZ0lEQzZ0SE8td0USE0Nnd0luck9wLXdVUXdQdkk5QUkiEglJyacmA0TlNBFCqJFsA0bSyioTQ2d3SS1wcWFnUVlRLUxiQ29nRQ\\u0026wv\\u003d1\\u0026s\\u003d81\",\"違反コンテンツを報告\",null,\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQoykIYigCMAA\"]\n,null,null,\"ChZDSUhNMG9nS0VJQ0FnSURDNnRIT2V3EAE\",\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4R4IXygCMAA\",[null,[[8,null,1]\n,806,3998,\"https://lh3.googleusercontent.com/a-/AOh14GgqoJaWWE4tVIQyBocMYxBYPTuC4pMtISKJ0An4L90\\u003dc0x00000000-cc-rp-ba6\",\"ハナカワ\",\"https://www.google.com/maps/contrib/117894898974601698628?hl\\u003dja-JP\",null,null,\"https://www.google.com/maps/contrib/117894898974601698628?hl\\u003dja-JP\"]\n,\"ハ\"]\n,null,null,null,0,0,\"https://www.google.com/maps/reviews/data\\u003d!4m5!14m4!1m3!1m2!1s117894898974601698628!2s0x0:0xcad246036c91a842?hl\\u003dja-JP\",null,null,null,[[2]\n]\n,null,0,null,null,1613139322340,null,null,[0,236]\n,[\"0\",\"-3831923352418539454\"]\n,\"ja\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,1600805278781,null,null,[\"/url?q\\u003dhttps://www.google.com/maps/contrib/117894898974601698628/reviews%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IYSgBMAA\\u0026usg\\u003dAOvVaw1x3agCFWr6C_Tc4XVWlnr6\",\"ハナカワ\",\"https://lh3.googleusercontent.com/a-/AOh14GgqoJaWWE4tVIQyBocMYxBYPTuC4pMtISKJ0An4L90\\u003dc0x00000000-cc-rp-ba6\",\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IYSgBMAA\"]\n,\"EgIIAw\"]\n,[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/108954312240976832250%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IZCgAMAA\\u0026usg\\u003dAOvVaw2-DXk6ti6HvbSFUpPlqTCq\",\"古中征太郎\",\"https://lh3.googleusercontent.com/a-/AOh14GjiObd988pPPd46Las4NbJtefsU1wnSwb0L9LvUQ9g\\u003dc0x00000000-cc-rp\",\"0ahUKEwjB7YKkzdHvAhVKM6wKHWofAQQQ4h4IZCgAMAA\"]\n,\"8 か月前\",null,\"沖縄の島から、船で20分で行ける無人島で、海がキレイな素敵な島です。事前予約で、コテージを予約する事をオススメします。なぜなら、日陰が無いのでずっと日に当たる事になり、日焼けや体力消耗、熱中症にもつながる可能性があります。無人島なので、直ぐに病院に行ける訳はありませんので。海の中の魚（熱帯魚）運が良ければウミガメ等を間近で見れます。サンゴで足を切ってしまうので、シュノーケリング4点セットをレンタルで借りるか、厚めのビーチサンダル等を必ず履いて海に入る事を守った方が無難です。シャワールーム、更衣室、トイレは、無料で使えて良心的です。海の家（レストラン）も在り、値段もそれ程高く無いので、良いと思います。（現金払い）船が出る迄の5時間、思う存分沖縄の海を楽しめると思います。沖縄に来たなら、是非一度行ってみて下さい。\",5,null,\"108954312240976832250\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChZDSUhNMG9nS0VJQ0FnSUM4eWRIb0VBEAE\\u0026entityid\\u003dChZDSUhNMG9nS0VJQ0
